import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';

function LeaderDashboard() {
  const { user, logout } = useAuth();
  const [employees, setEmployees] = useState([]);
  const [selectedDate, setSelectedDate] = useState(new Date().toISOString().split('T')[0]);
  const [reports, setReports] = useState({});

  // Simulando empleados por departamento
  useEffect(() => {
    const departmentEmployees = {
      medicare: ['Juan Pérez', 'María García', 'Carlos López'],
      vida: ['Ana Martín', 'Pedro Ruiz', 'Laura Sánchez'],
      auto: ['Miguel Torres', 'Carmen Díaz', 'Roberto Silva'],
      casa: ['Elena Morales', 'Francisco Vega', 'Isabel Castro'],
      comercial: ['David Herrera', 'Patricia Ramos', 'Andrés Jiménez']
    };

    setEmployees(departmentEmployees[user.department] || []);
  }, [user.department]);

  const handleReportChange = (employee, field, value) => {
    setReports(prev => ({
      ...prev,
      [employee]: {
        ...prev[employee],
        [field]: value
      }
    }));
  };

  const saveReports = () => {
    console.log('Guardando reportes:', { date: selectedDate, reports });
    alert('Reportes guardados exitosamente');
  };

  return (
    <div style={{ padding: '20px', maxWidth: '1200px', margin: '0 auto' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px' }}>
        <h1>Panel de {user.name} - Departamento {user.department.toUpperCase()}</h1>
        <button onClick={logout} style={{ padding: '8px 16px' }}>Cerrar Sesión</button>
      </div>

      <div style={{ marginBottom: '20px' }}>
        <label>Fecha del reporte: </label>
        <input
          type="date"
          value={selectedDate}
          onChange={(e) => setSelectedDate(e.target.value)}
          style={{ padding: '5px', marginLeft: '10px' }}
        />
      </div>

      <div style={{ display: 'grid', gap: '20px' }}>
        {employees.map(employee => (
          <div key={employee} style={{ 
            border: '1px solid #ddd', 
            padding: '20px', 
            borderRadius: '8px',
            backgroundColor: '#f9f9f9'
          }}>
            <h3>{employee}</h3>
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '15px' }}>
              <div>
                <label>Total de Ventas ($):</label>
                <input
                  type="number"
                  placeholder="0.00"
                  onChange={(e) => handleReportChange(employee, 'totalVentas', e.target.value)}
                  style={{ width: '100%', padding: '8px', marginTop: '5px' }}
                />
              </div>
              <div>
                <label>Descripción de Ventas:</label>
                <input
                  type="text"
                  placeholder="Detalle de las ventas realizadas"
                  onChange={(e) => handleReportChange(employee, 'descripcionVentas', e.target.value)}
                  style={{ width: '100%', padding: '8px', marginTop: '5px' }}
                />
              </div>
            </div>
            <div style={{ marginTop: '15px' }}>
              <label>Comentarios:</label>
              <textarea
                placeholder="Comentarios adicionales sobre el desempeño..."
                onChange={(e) => handleReportChange(employee, 'comentarios', e.target.value)}
                style={{ width: '100%', padding: '8px', marginTop: '5px', minHeight: '80px' }}
              />
            </div>
          </div>
        ))}
      </div>

      <button 
        onClick={saveReports}
        style={{ 
          marginTop: '30px', 
          padding: '12px 24px', 
          backgroundColor: '#28a745', 
          color: 'white', 
          border: 'none',
          borderRadius: '4px',
          fontSize: '16px'
        }}
      >
        Guardar Reportes del Día
      </button>
    </div>
  );
}

export default LeaderDashboard;
